import React from "react";
import { useAuth0 } from '@auth0/auth0-react'

const LogginButton = () => {
    const { loginWithRedirect } = useAuth0()
    return (
        <button class="favorite styled" onClick={() => loginWithRedirect()}>Login</button>
    )   
}

export default LogginButton
